import bugatti from './bugatti.png'
import imageCreate from './imager.js'
import './style.css'

function App() {
  const WIDTH = `600px`;
  const HEIGHT = `300px`;
  let ourImage = {
    src : bugatti,
    alt : 'son model bugatti',
    style : {
      width : WIDTH,
      height : HEIGHT,
    }
  }
  return (
    <div className='card'>
      <div>{imageCreate(ourImage)}</div>
    </div>
  );
}


export default App;
